import React, {useState} from 'react';
import GetMyCabins from '../../pages/mycabins/GetMyCabins';


export default function UserCabins(props){
    return(
        <div>
            <h3>Cabins</h3>
            <GetMyCabins id={props.match.params.id}/>
        </div>
    )
}
